import React from 'react';
import rogo from './../img/rogo.png';
import { makeStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import TextField from "@material-ui/core/TextField";
import SendIcon from "@material-ui/icons/Send";

const useStyles = makeStyles({
  head: {
    backgroundColor: "#00A3ff",
    display: "flex",
    alignItems: "center",
  },
  title: {
    fontSize: "40px",
    color: "white",
    borderBottom: "solid 5px #FFCC66",
  },
  button: {
    color: "#ffffff",
  },
  font: {
    color: "#ffffff",
  },
});

const Home = () => (
  <div>
    <img src={rogo} className="rogo" width="200px" alt="logo" />
    <h1>牛とともに生きる。</h1>
    <h1>食べることは、</h1>
    <h1>生きること。</h1>
  </div>
);

const App = () => {
  const classes = useStyles();
  return (
    <div>
      <div className={classes.head}>
        <h1 className={classes.title}>Home</h1>
      </div>
      <TextField
        id="test"
        label="Test"
        placeholder="test"
        multiline
        color="secondary"
        onChange={() => {}}
      />
      <Button
        variant="contained"
        color="primary"
        className={classes.button}
        endIcon={<SendIcon className={classes.font} />}
        onClick={() => {}}
      >
        Post
      </Button>
    </div>
  );
};


export default Home
